    }

    render() {
        return (
            <Layout>
            <ul>
                   {
                       this.props.posts.map( post =>{
                           { console.log(post.id) }
                           <li> { post.id } </li>
                        })
                   }
               </ul>
            </Layout> 
        )
    }
}

export default Commonts
